import React from 'react';
import { faUsers } from '@fortawesome/free-solid-svg-icons';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

function SidebarComponent() {
    return (
        <div className="w-72 h-screen fixed border border-black p-3 rounded-x mt-16">
            <div className="w-full h-screen bg-gray-200 px-9 py-10 ">
                <div className="flex flex-row w-full mt-2">
                    <FontAwesomeIcon className='mt-1' icon={faUsers} color='black' size="md" />
                    <h1 className="text-md font-semibold text-black ml-2">All users</h1>
                </div>
                <div className="flex flex-row w-full mt-2">
                    <FontAwesomeIcon className='mt-1' icon={faUsers} color='black' size="md" />
                    <h1 className="text-md font-semibold text-black ml-2">All Posts</h1>
                </div>
            </div>
        </div>
    );
}

export default SidebarComponent;
